const CartItems = (props) => {
    return ( 
        <div>
            {props.items.map(product => {
                return (
                    <div>
                    <div>
                        <img src={product.imageUrl} alt={product.title}/>
                    </div>
                    <div>
                        <h6> ${product.price}</h6>
                        <button>Add To Cart</button>
                    </div>
                    </div>
                )
            })}
        </div>
     );
}

export default CartItems;
